import {
	FETCH_COLLECTIONS_START,
	FETCH_COLLECTIONS_SUCCESS,
	FETCH_COLLECTIONS_FAIL,
} from './shopTypes'

export const fetchCollectionsStart = (collectionsMap) => (dispatch) => {
	dispatch({
		type: FETCH_COLLECTIONS_START,
	})
}
